import { useState, useEffect } from "react";

function SearchBar({ onSearch }) {
  const [patient_id, setPatientId] = useState("");

  function submitPatientId(e) {
    e.preventDefault();
    onSearch(patient_id);
    setPatientId("");
  }

  return (
    <form className="add-form" onSubmit={submitPatientId}>
      <div className="form-control">
        <input
          type="text"
          placeholder="Add patient id"
          value={patient_id}
          onChange={e => setPatientId(e.target.value)}
        />
      </div>

      <input type="submit" value="Search" className="btn btn-block" />
    </form>
  );
}

export default SearchBar;

function Dashboard({}) {
  const [loading, setLoading] = useState(true);
  const [results, setResults] = useState("");

  useEffect(() => {
    var url =
      "http://20.191.211.229:5000/v1/datafiles?patient_id=DMG915&max_size=1000";

    fetch(url, {
      method: "GET",
      headers: {
        "Content-Type": "application/json"
      }
    })
      .then(res => {
        return res.json();
      })
      .then(data => {
        setLoading(false);
        setResults(data);
      });
  });

  return (
    <div>
      {this.state.loading || !this.state.results ? (
        <h1>Loading...</h1>
      ) : (
        <div>
          {this.state.results.map(result => {
            return <h1>{result.filename}</h1>;
          })}
        </div>
      )}
    </div>
  );
}
